prompt --application/shared_components/logic/application_processes/fetch_answer
begin
wwv_flow_imp_shared.create_flow_process(
 p_id=>wwv_flow_imp.id(70904784267061482845)
,p_process_sequence=>1
,p_process_point=>'ON_DEMAND'
,p_process_type=>'NATIVE_PLSQL'
,p_process_name=>'fetch_answer'
,p_process_sql_clob=>wwv_flow_string.join(wwv_flow_t_varchar2(
'DECLARE',
'    l_answer VARCHAR2(4000);',
'BEGIN',
'    SELECT ANSWER',
'    INTO l_answer',
'    FROM ASNT_SMS_CHATBOT_SUB_QUESTION_ANSWER',
'    WHERE SUB_QUESTION_ID = TO_NUMBER(APEX_APPLICATION.G_X01);',
'',
'    SYS.HTP.P(l_answer);',
'',
'',
'EXCEPTION',
'    WHEN NO_DATA_FOUND THEN',
'        SYS.HTP.P(''No answer found.'');',
'    WHEN OTHERS THEN',
'        SYS.HTP.P(''Unexpected error: '' || SQLERRM);',
'END;'))
,p_process_clob_language=>'PLSQL'
,p_security_scheme=>'MUST_NOT_BE_PUBLIC_USER'
,p_version_scn=>15644105370350
);
end;
