prompt --application/shared_components/logic/application_processes/fetch_sub_question
begin
wwv_flow_imp_shared.create_flow_process(
 p_id=>wwv_flow_imp.id(70904876677536491508)
,p_process_sequence=>1
,p_process_point=>'ON_DEMAND'
,p_process_type=>'NATIVE_PLSQL'
,p_process_name=>'fetch_sub_question'
,p_process_sql_clob=>wwv_flow_string.join(wwv_flow_t_varchar2(
'DECLARE',
'  l_json CLOB;',
'BEGIN',
'  SELECT JSON_ARRAYAGG(',
'           JSON_OBJECT(',
'             ''id'' VALUE SUB_QUESTION_ID,',
'             ''question'' VALUE SUB_QUESTION',
'           )',
'         )',
